import React from "react";
import { Link, NavLink } from "react-router-dom";
import { NavItem, Nav, Button, Card, CardHeader, CardText, CardBody, CardTitle, Row, Col } from "reactstrap";

class Navigation extends React.Component {
  constructor(props, context) {
    super(props, context);

    this.state = {
      open: true
    };
  }

  handleSelect(activeKey) {
    console.log("Activedd key is: ", activeKey);
    this.setState({ activeKey });
  }

  render() {
    //console.log("ACTIVE KEY IS: ", this.state.activeKey);
    return (
      <div className="sidenav">
        <Card>
          <NavLink to="/">
            <CardHeader>
              Home
            </CardHeader>
          </NavLink>
        </Card>
        <Card>
          <NavLink to="/creative">
            <CardHeader>
              Creative
            </CardHeader>
          </NavLink>
          <NavLink to="/creative/chord-art">
            <CardBody>
              Chord Art
            </CardBody>
          </NavLink>
        </Card>
        <Card>
          <NavLink to="/repetitive">
            <CardHeader>
              Repetitive
            </CardHeader>
          </NavLink>
          <NavLink to="/repetitive/kochpinski">
            <CardBody>
              Kochpinski
            </CardBody>
          </NavLink>
          <NavLink to="/repetitive/snowflake">
            <CardBody>
              Snowflake
            </CardBody>
          </NavLink>
          <NavLink to="/repetitive/plasma-ball">
            <CardBody>
              Plasma Ball
            </CardBody>
          </NavLink>
        </Card>
      </div>
    );
  }
}


export default Navigation;
